One Life

Nature Documentary hosted by Daniel Craig, published by BBC broadcasted as part of BBC Earth Films series in 2011 - English narration


Information
------------------------------

BBC Earth Films: One Life
More than four years in the making and packed full of filming firsts, One Life captures unprecedented and beautiful sequences of animal behaviour guaranteed to bring you closer to nature than ever before, as well as a second disc packed full of never before seen extras including an exclusive making of featurette narrated by Daniel Craig, interviews with the directors and cameramen who witness these incredible natural phenomena first hand, as well as a host of unique clips of the world s most amazing and astounding creatures available only on DVD. A major feature length production from BBC Earth Films, One Life has been created from10,000 hours of incredible, intimate footage of amazing creatures that are in turn heroic, strange, loveable, beautiful and surprisingly funny. One Life is voiced by Daniel Craig and offers an accessible narrative that children will love. It is a joyful celebration of the most brilliant and imaginative stories of survival from the natural world.

